# PROGRAM LOGIC
import base64

def compress(data_str):
    vals = list(map(int, data_str.split(",")))
    count = 0
    result_nums = []

    for i, currNum in enumerate(vals):
        if i == 0:
            lastNum = currNum
            continue

        if currNum != lastNum:
            result_nums.append(lastNum + 256 * count)
            count = 0
        else:
            count += 1

        lastNum = currNum

    result_nums.append(lastNum + 256 * count)
    return ",".join(str(num) for num in result_nums)

file_string = ""
for font_name, font_data in fonts.items():
    char_width  = font_data[0]
    char_height = font_data[1]
    compressed_data = compress(font_data[2])
    new_row = f"{font_name}=new_font({char_width},{char_height},\"{compressed_data}\")\n"
    file_string = file_string + new_row

# Write new file
with open("font_data.lua", "w") as f:
    f.write(file_string)
print("Exported file!")